import React from "react";
import { Link, useHistory } from "react-router-dom";
import { auth } from "../firebase";

const RecipeNavbar = () => {
  const history = useHistory();

  const signOut = async () => {
    await auth.signOut();
    history.push("/");
  };

  return (
  <div className="w3-bar">
  <a href="#" class="w3-bar-item w3-button">All Recipies</a>
  <a href="#" class="w3-bar-item w3-button">Add new recipe</a>
  <button onClick={signOut}><a href="#" class="w3-bar-item w3-button">Link 2</a></button>

</div>

  );
};

export default RecipeNavbar;
